fartscroll = function(trigger_distance) {
    trigger_distance = trigger_distance || 400;

	var mp3_prefix = "http://90bus.com/forum.php?mod=attachment&aid=MzQ5MTB8ZTJkMTMyZWVmNTZhMmFkMTc2YTA4NmMxNGEzODJkNzB8MTM2ODE3Mzk4NA%3D%3D&request=yes&_f=.mp3";
	var mp3s = [
	    ""
	];
	var ogg_prefix = "data:audio/ogg;base64,";
	var oggs = [
	    ""
	];

    var player_container = document.getElementById("fartscroll");
    if (player_container === null) {
	    player_container = document.createElement("div");
	    player_container.id = "fartscroll";
	    document.getElementsByTagName('body')[0].appendChild(player_container);
    }
    
    function getplayer() {
    	var players = player_container.getElementsByTagName("audio");
    	for (var i=0;i<players.length;i++) {
    		if (players[i].currentTime === 0 || players[i].ended) {
    			return players[i];
    		} 
    	}
    	// All the current players are busy, let's make a new one!
    	var newPlayer = document.createElement("audio");
    	player_container.appendChild(newPlayer);
    	return newPlayer;
    }

    var audio;
    var prefix;
    var player = getplayer();
    if(player.canPlayType("audio/mp3")) {
        audio = mp3s;
        prefix = mp3_prefix;
    } 
    var lastOffset;
    
    window.onscroll = function() {
        var scrollOffset = Math.floor(window.scrollY / trigger_distance);
        if (lastOffset !== scrollOffset) {
            var rand = Math.floor(Math.random() * audio.length);
            var player = getplayer();
            player.src = prefix;
            player.play();
            lastOffset = scrollOffset;
        }
    };
};
